import React from 'react';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import Home from './Home';
import './App.css';

function App() {
  return (
    <Router>
      <div className="app">
        <img src="/logo.png" alt="Logo" className="logo" />
        <Switch>
          <Route path="/:mysource" component={Home} />
        </Switch>
      </div>
    </Router>
  );
}

export default App;
